CREATE TABLE `dream_u_finance_io` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `type` int(1) NOT NULL COMMENT '20-29为支付类型',
  `type_detail` int(11) NOT NULL COMMENT '支付具体类型',
  `platform_id` int(11) DEFAULT NULL COMMENT '平台id',
  `remark` varchar(255) DEFAULT NULL COMMENT '充提类型描述',
  `money` double(15,6) NOT NULL COMMENT '充提金额',
  `commission` double(15,6) DEFAULT '0.000000' COMMENT '根据各平台计算得出本次手续费',
  `redbag` double(15,6) DEFAULT NULL COMMENT '系统存入或抹掉的红包数量',
  `status` int(11) NOT NULL COMMENT '0：刚刚发起 1：最新发起成功 -1表示请求旧数据 2支付成功 -2支付失败',
  `self_order_id` varchar(255) NOT NULL COMMENT '支付对象id如借款id和账号id',
  `third_order_id` varchar(255) DEFAULT NULL COMMENT '第三方平台通知过来的唯一标识',
  `submit_order_id` varchar(255) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `promotion_type` tinyint(4) DEFAULT NULL COMMENT '优惠类型',
  `deduction_money` double DEFAULT NULL COMMENT '优惠抵扣金额',
  `src` varchar(50) DEFAULT NULL COMMENT '来源的业务模块',
  `pay_type_id` int(11) DEFAULT NULL COMMENT '充值方式ID',
  `rule_id` int(11) DEFAULT NULL COMMENT '支付规则ID',
  `label` varchar(255) DEFAULT NULL COMMENT '支付类型名称',
  `act_amount` double(15,6) DEFAULT NULL COMMENT '实际到账金额',
  `audit_remark` text,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `submit_order_id` (`submit_order_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1706522549065588737 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
