--
-- Table structure for table `dream_u_user_bankcard`
--

DROP TABLE IF EXISTS `dream_u_user_bankcard`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dream_u_user_bankcard` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_id` int(11) NOT NULL COMMENT '用户id,用用户表中的主键id作为本表中的userid',
  `real_name` varchar(50) NOT NULL COMMENT '真实姓名',
  `id_card` varchar(18) DEFAULT NULL COMMENT '身份证号',
  `id_status` int(2) NOT NULL DEFAULT '0' COMMENT '账户实名认证状态，0：未认证；1：已填写；2：已认证',
  `bank_id` int(11) DEFAULT NULL,
  `issuing_bank` int(11) DEFAULT NULL COMMENT '发卡行标识',
  `issuing_bank_name` varchar(255) NOT NULL COMMENT '发卡行名字',
  `card_number` varchar(255) DEFAULT NULL COMMENT '银行卡号',
  `card_phone` varchar(20) DEFAULT NULL COMMENT '银行卡绑定的手机号',
  `card_state` int(11) DEFAULT '0' COMMENT '银行卡的认证状态，0姓名、身份证已填写；1银行卡已填写；2已认证',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `bind_status` int(11) NOT NULL DEFAULT '0' COMMENT '银行卡状态  0未绑定  1已填写  2已绑定',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
